    false,nt"url": null,nt"notes": "Incidents in City of Austin Full Purpose
    which AFD responded to, minus medical calls.rnrnSee Attachment for Metadata PDF.
    rnrnData DescriptionsrnMasterIncidentNumber = unique identifier for individual incidents.
    If you encounter multiple rows with same MasterIncident number, it is b/c that incident
    had a multi-unit response.  Please refer to RespondingUnit to determine the number
    of units responding to the individual incident.rn rnCalendarYear = calendar year
    in which individual incident occurredrnrnMonth = month in which individual incident
    occurredrnrnDayOfMonth = calendar date in which individual incident occurred (Ex:
    10 = 10th day in month)rnrnCall_Type = generalized description of incident type
    for individual incidents. rnrnBattalion = Battalion in which individual incident
    occurred. A Battalion is a geographic boundary used for management of stations (Ex:
    Station 1, 2, 3, 4 are in Battalion 1)rnrnJurisdiction = Boundary of jurisdiction/department
    in which individual incident occurred. AFD = City of Austin Full Purpose rnrnResponseArea
    = Small geographic boundary (often tied to a specific stations) in which individual
    incident occurred. Ex: 00-0101 is a ResponseArea for Station 1.  Also referred to
    as Fire Box.rnrnTSUPResponseStatus = Level of response.  Code 1 = no lights/sirens,
    travels speedlimit.  Code 3 = lights/sirens, will travel faster than speedlimit.rnPriority
    Description = Level of Priority of incident. Number equals priority (3 = Priority
    3), letter equals general incident type (F=Fire)rnrnResponding Unit = Units which
    responded to individual incident rnrnDistrict = Boundary of City Council single-member
    district in which individual incident occurredrnrnLatitude = non-decimal latitude.
